import org.junit.jupiter.api.BeforeAll;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.*;

class ValidAnagramTest {

    private static ValidAnagram validAnagram;

    @BeforeAll
    public static void beforeAll() {
        validAnagram = new ValidAnagram();
    }

    @Test
    public void testCase1() {
        String input1 = "anagram";
        String input2 = "nagaram";
        boolean output = validAnagram.isAnagram(input1, input2);
        assertEquals(true, output);
    }

    @Test
    public void testCase2() {
        String input1 = "prospect";
        String input2 = "propssct";
        boolean output = validAnagram.isAnagram(input1, input2);
        assertEquals(false, output);
    }

    @Test
    public void testCase3() {
        String input1 = "a";
        String input2 = "b";
        boolean output = validAnagram.isAnagram(input1, input2);
        assertEquals(false, output);
    }

    @Test
    public void testCase4() {
        String input1 = "aacc";
        String input2 = "ccac";
        boolean output = validAnagram.isAnagram(input1, input2);
        assertEquals(false, output);
    }

    @Test
    public void testCase5() {
        String input1 = "";
        String input2 = "";
        boolean output = validAnagram.isAnagram(input1, input2);
        assertEquals(true, output);
    }



}